import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import Sidebar from '../comman/Sidebar';
import Header from '../comman/Header';
import { getUserByUsername, blockUser } from "../../api";
import { Link } from 'react-router-dom';

const UserDetails = ({ match }) => {
    const { userName } = useParams();
    const [userData, setUserData] = useState([]);
    const [phoneNo, setPhoneNumber] = useState("");
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [gender, setGender] = useState("");
    const [referrerCode, setReferrerCode] = useState("");
    const [balance, setBalance] = useState("");
    const [userNa, setUserName] = useState("");
    const [dob, setDob] = useState("");

    const handlegetUserByUsername = async (userName) => {
        try {
            const result = await getUserByUsername(userName);
            setUserData(result.data);
            // Destructure user data for better readability
            const [user] = result.data;
            setPhoneNumber(user?.phoneNumber);
            setFirstName(user?.firstName);
            setLastName(user?.lastName);
            setGender(user?.gender);
            setReferrerCode(user?.referrerCode);
            setBalance(user?.balance);
            setUserName(user?.userName);
            setDob(user?.dob);
        } catch (error) {
            console.error("Error fetching user data:", error);
        }
    };

    const handleBlockUser = async () => {
        try {
          await blockUser(phoneNo);
          // Optionally, you can update your local state or perform other actions
          console.log('User blocked successfully.');
        } catch (error) {
          console.error('Error blocking user:', error);
        }
      };

    useEffect(() => {
        handlegetUserByUsername(userName);
    }, []);

    return (
        <div>
            <body id="page-top">

                {/*  <!-- Page Wrapper --> */}
                <div id="wrapper">

                    {/*  <!-- Sidebar --> */}
                    <Sidebar />
                    {/*  <!-- End of Sidebar --> */}

                    {/*  <!-- Content Wrapper --> */}
                    <div id="content-wrapper" className="d-flex flex-column">

                        {/*  <!-- Main Content --> */}
                        <div id="content">

                            {/*  <!-- Topbar --> */}
                            <Header />
                            {/*  <!-- End of Topbar --> */}

                            {/* <!-- Begin Page Content --> */}
                            <div className="container">
                                {/*   <!-- Content Row --> */}
                                <div className="row">

                                    {/*   <!-- Content Column --> */}
                                    <div className='col-lg-12 mb-4 col-sm-12'>
                                        <div className="table-container" style={{ overflowX: 'auto' }}>
                                            <div className="row">
                                                <div className="col">
                                                    <h5 className="pb-2 mb-0">User Details</h5>
                                                </div>
                                            </div>
                                            <hr />
                                            <div className="">
                                                {/* Conditionally render each piece of information */}
                                                {firstName && <p><b>First Name :</b> {firstName}</p>}
                                                {lastName && <p><b>Last Name :</b> {lastName}</p>}
                                                {userNa && <p><b>User Name :</b> {userNa}</p>}
                                                {phoneNo && <p><b>Phone No. :</b> {phoneNo}</p>}
                                                {gender && <p><b>Gender :</b> {gender}</p>}
                                                {dob && <p><b>Dob :</b> {dob}</p>}
                                                {balance !== undefined && <p><b>Balance :</b> {balance}</p>}
                                                {referrerCode && <p><b>Referral code :</b> {referrerCode}</p>}
                                                <button type="button" className="btn btn-danger mx-5 px-5" onClick={handleBlockUser}>Block</button>
                                            </div>
                                        </div>
                                    </div>

                                </div>

                            </div>
                            {/*   <!-- /.container-fluid --> */}

                        </div>
                        {/*   <!-- End of Main Content -->

                        <!-- Footer --> */}
                        <footer className="sticky-footer bg-white">
                            <div className="container my-auto">
                                <div className="copyright text-center my-auto">
                                    <span>Copyright &copy; Your Website 2023</span>
                                </div>
                            </div>
                        </footer>
                        {/* <!-- End of Footer --> */}

                    </div>
                    {/*  <!-- End of Content Wrapper --> */}

                </div>
                {/*  <!-- End of Page Wrapper -->

                 <!-- Scroll to Top Button--> */}
                <a className="scroll-to-top rounded" href="#page-top">
                    <i className="fas fa-angle-up"></i>
                </a>
            </body>
        </div>
    );
};

export default UserDetails;
